                    { 2216, "Аллергические заболевания органов дыхания, кожи и переднего отрезка глаза#Тотальные дистрофические поражения верхних дыхательных путей#Дисбактериоз любой локализации#Заболевания эндокринной системы#Выраженные расстройства вегетативной (автономной) нервной системы#", 1, "1 раз в 2 года", "применение", "1.3.9.4.2." },
                    { 2217, "Аллергические заболевания различных органов и систем#Тотальные дистрофические поражения верхних дыхательных путей#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#", 1, "1 раз в 2 года", "витаминыА (производство, применение)", "1.3.9.5." },
                    { 2206, "Тотальные дистрофические и аллергические заболевания верхних дыхательных путей#Заболевания верхних дыхательных путей и кожи, склонные к перерождению (гиперпластический ларингит, гиперкератозы, дискератозы, пигментные множественные папилломы и невусы и другие)#Хронические заболевания бронхолегочной системы#Заболевания гепатобилиарной системы тяжелого течения, часто рецидивирующие (более 2 раз за календарный год)#Содержание гемоглобина менее 130 г/л у мужчин и менее 120 г/л у женщин#Хронические заболевания периферической нервной системы с частотой обострения 3 раза и более за календарный год#", 1, "1 раз в год", "Смеси углеводородов: нефти, бензиныР, керосины, уайт-спиритР, мазуты, битумы, асфальты, каменноугольные и нефтяные смолыК, пекиК, возгоны каменноугольных смол и пековК, масла минеральныеК (не полностью очищенные минеральные масла, сланцевые смолыАК и маслаАК)", "1.3.5." },
                    { 2246, "Острые и хронические заболевания, включая их последствия#Аномалии развития#", 1, "1 раз в год", "Пониженная гравитация (невесомость)", "4.2." },
                    { 2291, "Медицинские противопоказания, изложенные в подпункте 28.6 настоящей графы.#", 2, "1 раз в 2 года", "категории \"C1\"", "27.7." },
                    { 2248, "Хронические заболевания периферической нервной системы с частотой обострения 3 раза и более за календарный год#Заболевания скелетно-мышечной системы с частотой обострения 3 раза и более за календарный год# Облитерирующие заболевания сосудов вне зависимости от степени компенсации#Болезнь и синдром Рейно#Варикозное расширение вен нижних конечностей, тромбофлебит, геморрой#Выраженный энтероптоз, грыжи, выпадение прямой кишки#Опущение (выпадение) женских половых органов#Хронические воспалительные заболевания матки и придатков с частотой обострения 3 раза и более за календарный год#Гипертоническая болезнь III стадии, 2 степени, риск III#Хронические болезни сердца и перикарда с недостаточностью кровообращения I - II степени#Ишемическая болезнь сердца: стенокардия ФК II, риск средний#Миопия высокой степени или осложненная близорукость#Дистрофические изменения сетчатки#Нарушения функции вестибулярного аппарата любой этиологии#", 1, "1 раз в год", "Физические перегрузки (физическая динамическая нагрузка, масса поднимаемого и перемещаемого груза вручную, стереотипные рабочие движения, статическая нагрузка, рабочая поза, наклоны корпуса, перемещение в пространстве) (при отнесении условий труда по данным факторам по результатам аттестации рабочих мест по условиям труда к подклассу вредности 3.1 и выше)", "4.1." },
                    { 2277, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы) - только для работников медицинских и детских дошкольных учреждений, непосредственно связанных с обслуживанием детей, - на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#8) озена#", 2, "1 раз в год", "Работы в дошкольных образовательных организациях, домах ребенка, организациях для детей-сирот и детей, оставшихся без попечения родителей (лиц, их заменяющих), образовательных организациях интернатного типа, оздоровительных образовательных организациях, в том числе санаторного типа, детских санаториях, круглогодичных лагерях отдыха, а также организациях социального обслуживания, осуществляющих предоставление социальных услуг в стационарной форме социального обслуживания, полустационарной форме социального обслуживания, в форме социального обслуживания на дому", "20." },
