                    { 2279, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы) - только для работников медицинских и детских дошкольных учреждений, непосредственно связанных с обслуживанием детей, - на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#8) озена#", 2, "1 раз в год", "Работы в бассейнах, а также водолечебницах", "22." },
                    { 2280, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы);#8) озена#", 2, "1 раз в год", "Работы в гостиницах, общежитиях, пассажирских вагонах (проводники), в должности стюардессы", "23." },
                    { 2281, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы);#8) инфекции кожи и подкожной клетчатки#", 2, "1 раз в год", "Работы в организациях медицинской промышленности и аптечной сети, связанные с изготовлением, расфасовкой и реализацией лекарственных средств", "24." },
                    { 2282, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы);#8) инфекции кожи и подкожной клетчатки#", 2, "1 раз в год", "Работы на водопроводных сооружениях, связанные с подготовкой воды и обслуживанием водопроводных сетей", "25." },
                    { 2283, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы);#8) инфекции кожи и подкожной клетчатки;#9) озена#", 2, "1 раз в год", "Работы, связанные с переработкой молока и изготовлением молочных продуктов", "26." },
                    { 2284, "Рост, вес, определение группы крови и резус-фактора (при прохождении предварительного медицинского осмотра)#Аудиометрия#Исследование вестибулярного анализатора#Острота зрения#Цветоощущение#Определение полей зрения#Биомикроскопия сред глаза#Офтальмоскопия глазного дна#", 2, "1 раз в 2 года", "Управление наземными транспортными средствами:", "27." },
                    { 2285, "1) Острота зрения с коррекцией ниже 0,6 на лучшем глазу, ниже 0,2 - на худшем. Допустимая коррекция при близорукости и дальнозоркости 8,0 D, в том числе контактными линзами, астигматизме - 3,0 D (сумма сферы и цилиндра не должна превышать 8,0 D). Разница в силе линз двух глаз не должна превышать 3,0 D.#2) Отсутствие зрения на одном глазу при остроте зрения ниже 0,8 (без коррекции) на другом.#3) Центральная скотома абсолютная или относительная (при скотоме и наличии изменений зрительной функции не ниже значений, указанных в п. 1 настоящей графы подпункта - допуск без ограничений).#4) Состояние после рефракционных операций на роговой оболочке (кератотомия, кератомилез, кератокоагуляция, рефракционная кератопластика). Допускаются к вождению лица через 3 месяца после операции при остроте зрения с коррекцией не ниже 0,6 на лучшем глазу, не ниже 0,2 - на худшем.#5) Допустимая коррекция при близорукости и дальнозоркости 8,0 D, в том числе контактными линзами, астигматизме - 3,0 D (сумма сферы и цилиндра не должна превышать 8,0 D). Разница в силе линз двух глаз не должна превышать 3,0 D, при отсутствии осложнений и исходной (до операции) рефракции - от +8,0 до -8,0 D. При невозможности установить дооперационную рефракцию вопросы профессиональной пригодности решаются положительно при длине оси глаза от 21,5 до 27,0 мм.#6) Искусственный хрусталик, хотя бы на одном глазу. Допускаются стажированные водители при остроте зрения с коррекцией не ниже 0,6 на лучшем глазу, не ниже 0,2 - на худшем. Допустимая коррекция при близорукости и дальнозоркости 8,0 D, в том числе контактными линзами, астигматизме - 3,0 D (сумма сферы и цилиндра не должна превышать 8,0 D). Разница в силе линз двух глаз не должна превышать 3,0 D, нормальное поле зрения и отсутствие осложнений в течение полугода после операции.#7) Хронические заболевания оболочек глаза, сопровождающиеся значительным нарушением функции зрения, стойкие изменения век, в том числе и их слизистых оболочек, парезы мышц век, препятствующие зрению или ограничивающие движение глазного яблока (после оперативного лечения с положительным результатом допуск осуществляется индивидуально).#8) Хроническое, не поддающееся консервативному лечению воспаление слезного мешка, а также упорное, не поддающееся лечению слезотечение.#9) Паралитическое косоглазие и другие нарушения содружественного движения глаз.#10) Стойкая диплопия вследствие косоглазия любой этиологии.#11) Спонтанный нистагм при отклонении зрачков на 70° от среднего положения.#12) Ограничение поля зрения более чем на 20° в любом из меридианов.#13) Нарушение цветоощущения.#14) Заболевания сетчатки и зрительного нерва (пигментный ретинит, атрофия зрительного нерва, отслойка сетчатки и др.).#15) Глаукома.#16) Отсутствие одной верхней или нижней конечности, кисти или стопы, а также деформация кисти или стопы, значительно затрудняющая их движение. В порядке исключения могут допускаться лица с одной ампутированной голенью, если ампутационная культя не менее 1/3 голени и подвижность в коленном суставе ампутированной конечности полностью сохранена.#17) Отсутствие пальцев или фаланг, а также неподвижность в межфаланговых суставах:#отсутствие двух фаланг большого пальца на правой или левой руке;#отсутствие или неподвижность двух или более пальцев на правой руке или полное сведение хотя бы одного пальца;#отсутствие или неподвижность трех или более пальцев на левой руке или полное сведение хотя бы одного пальца (при сохранении хватательной функции и силы кисти вопрос о допуске к управлению решается индивидуально).#18) Укорочение нижней конечности более чем на 6 см - освидетельствуемые могут быть признаны годными, если конечность не имеет дефектов со стороны костей, мягких тканей и суставов, объем движений сохранен, длина конечности более 75 см (от пяточной кости до середины большого вертела бедра).#19) Отсутствие верхней конечности или кисти, отсутствие нижней конечности на любом уровне бедра или голени при нарушении подвижности в коленном суставе.#20) Травматические деформации и дефекты костей черепа с наличием выраженной неврологической симптоматики, препятствующей управлению транспортными средствами. При наличии незначительной неврологической симптоматики допуск осуществляется индивидуально с переосвидетельствованием через один год.#21) Полная глухота на одно ухо (острота слуха: разговорная речь на другое ухо менее 3 м, шепотная речь менее 1 м, или разговорная речь на каждое ухо менее 2 м (при полной глухоте, глухонемоте допуск осуществляется с переосвидетельствованием не реже чем 1 раз в год), за исключением отсутствия слуха, выраженных и значительно выраженных нарушений слуха (глухота и III, IV степень тугоухости))#22) Хроническое одностороннее или двустороннее гнойное воспаление среднего уха, осложненное холестеатомой, грануляциями или полипом (эпитимпанит). Наличие фистульного симптома (после оперативного лечения с хорошим результатом вопрос решается индивидуально).#23) Хронический гнойный мастоидит, осложнения вследствие мастоидэктомии (киста, свищ).#24) Заболевания любой этиологии, вызывающие нарушения функции вестибулярного анализатора, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.).#25) Болезни эндокринной системы прогрессирующего течения со стойкими выраженными нарушениями функций других органов и систем (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования после обследования и лечения у эндокринолога).#26) Ишемическая болезнь сердца: стенокардия нестабильная, стенокардия напряжения, ФК III ст., нарушения сердечного ритма высокой градации либо сочетание указанных состояний (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования после обследования и лечения у кардиолога).#27) Гипертоническая болезнь III стадии, 3 степени, риск IV (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования по результатам лечения и рекомендаций кардиолога).#28) Болезни бронхолегочной системы с явлениями дыхательной недостаточности или легочно-сердечной недостаточностью 2 - 3 ст. (допуск к вождению решается индивидуально после обследования и лечения у пульмонолога).#29) Выпадение матки и влагалища, ретровагинальные и пузырно-влагалищные свищи, разрывы промежности с нарушением целостности сфинктеров прямой кишки, водянка яичка или семенного канатика, грыжи и другие заболевания, вызывающие ограничения и болезненность движений, препятствующих управлению транспортными средствами.#", 2, "1 раз в 2 года", "категории \"A\"", "27.1." },
