                    { 2275, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#6) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#7) гонорея (все формы) - только для работников медицинских и детских дошкольных учреждений, непосредственно связанных с обслуживанием детей, - на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#8) озена#", 2, "1 раз в год", "Работы в образовательных организациях всех типов и видов, а также детских организациях, не осуществляющих образовательную деятельность (спортивные секции, творческие, досуговые детские организации и т.п.)", "18." },
                    { 2273, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) педикулез;#6) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#7) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#8) гонорея (все формы) на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#9) инфекции кожи и подкожной клетчатки - только для акушерских и хирургических стационаров, отделений патологии новорожденных, недоношенных, а также занятых изготовлением и реализацией пищевых продуктов;#10) озена#", 2, "1 раз в год", "Работы, выполняемые учащимися образовательных организаций общего и профессионального образования перед началом и в период прохождения практики в организациях, работники которых подлежат медицинским осмотрам (обследованиям)", "16." },
                    { 2249, "Острота зрения с коррекцией при предварительном медосмотре ниже 1,0 на одном глазу и 0,8 на другом; при периодических медосмотрах - ниже 0,8 на одном глазу и 0,5 на другом глазу#Аномалии рефракции: при предварительном осмотре - миопия выше 5,0 Д, гиперметропия выше 3,0 Д, астигматизм выше 1,5 Д; при повторных медосмотрах: миопия выше 8,0 Д, гиперметропия выше 6,0 Д, астигматизм выше 3,0 Д#Отсутствие бинокулярного зрения#Снижение аккомодации ниже возрастных норм#Лагофтальм#Хронические заболевания переднего отрезка глаз (век, конъюнктивы, роговицы, слезовыводящих путей)#Заболевания зрительного нерва, сетчатки#", 1, "1 раз в год", "Размер объекта различения (при отнесении условий труда по данному фактору по результатам аттестации рабочих мест по условиям труда к вредным условиям)", "4.4.1." },
                    { 2250, "Острота зрения с коррекцией не ниже 0,5 на одном глазу и 0,2 на другом глазу#Аномалии рефракции: при предварительном осмотре - миопия выше 6,0 Д, гиперметропия выше 4,0 Д, астигматизм выше 2,0 Д, при повторных периодических осмотрах: миопия выше 10,0 Д, гиперметропия выше 6,0 Д, астигматизм выше 4,0 Д#Отсутствие бинокулярного зрения#Снижение аккомодации ниже возрастных норм#Лагофтальм#Хронические заболевания переднего отрезка глаза#Заболевания зрительного нерва, сетчатки", 1, "1 раз в 2 года", "Размер объекта различения (при отнесении условий труда по данному фактору по результатам аттестации рабочих мест по условиям труда к вредным условиям)", "4.4.2." },
                    { 2251, "Острота зрения с коррекцией не менее 0,9 на одном и 0,6 на другом глазу при предварительном медосмотре; не менее 0,7 на одном и 0,5 на другом глазу при повторном периодическом медосмотре#Аномалии рефракции: миопия выше 5,0 Д, гиперметропия выше 3,0 Д, астигматизм более 1,5 Д при предварительном медосмотре; миопия выше 8,0 Д, гиперметропия выше 4,0 Д, астигматизм выше 2,0 Д при повторных периодических медосмотрах#Снижение аккомодации ниже возрастных норм#Нарушение цветоощущения, если цвет несет информационную нагрузку#Лагофтальм#Хронические воспалительные и аллергические заболевания защитного аппарата и оболочек глазного яблока#Заболевания зрительного нерва, сетчатки#", 1, "1 раз в 2 года", "Работы с оптическими приборами (микроскопами, лупами и пр.) (при отнесении условий труда по данному фактору по результатам аттестации рабочих мест по условиям труда к вредным условиям)", "4.4.3." },
                    { 2252, "1) Грыжи, препятствующие работе и имеющие наклонность к ущемлению#2) Хронические заболевания периферической нервной системы с обострениями 3 и более раза за календарный год#3) Хроническая ишемия мозга (дисциркуляторная энцефалопатия)#4) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#5) Нарушение функции вестибулярного анализатора любой этиологии#6) Стойкое понижение слуха (3 и более месяца) любой этиологии одно- и двустороннее (острота слуха: шепотная речь не менее 3 м), за исключением отсутствия слуха, выраженных и значительно выраженных нарушений слуха (глухота и III, IV степень тугоухости) у лиц, прошедших профессиональное обучение, в том числе обучение безопасным методам и приемам выполнения работ#7) Болезни органов зрения:#а) острота зрения без коррекции ниже 0,5 на одном глазу и ниже 0,2 - на другом;#б) ограничение поля зрения более чем 20°;#в) не поддающиеся лечению дакриоциститы и неизлечимое слезотечение;#г) миопия высокой степени#8) Рецидивирующий тромбофлебит геморроидальных вен и вен нижних конечностей#9) Беременность и период лактации#", 2, "1 раз в год", "Работы на высоте, верхолазные работы, а также работы по обслуживанию подъемных сооружений, включая:", "1." },
                    { 2253, "1) Грыжи, препятствующие работе и имеющие наклонность к ущемлению#2) Хронические заболевания периферической нервной системы с обострениями 3 и более раза за календарный год#3) Хроническая ишемия мозга (дисциркуляторная энцефалопатия)#4) Стойкое понижение слуха (3 и более месяца) любой этиологии, одно- и двустороннее (острота слуха: шепотная речь не менее 3 м)#5) Нарушение функции вестибулярного анализатора любой этиологии#6) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#7) Болезни органов зрения:#а) острота зрения без коррекции ниже 0,5 на одном глазу и ниже 0,2 - на другом;#б) ограничение поля зрения более чем 20°;#в) не поддающиеся лечению дакриоциститы и неизлечимое слезотечение;#г) миопия высокой степени#8) Рецидивирующий тромбофлебит геморроидальных вен и вен нижних конечностей#9) Беременность и период лактации#", 2, "1 раз в 2 года", "Работы в качестве крановщика (машиниста крана)", "1.1." },
                    { 2254, "1) Нарушение функции вестибулярного анализатора любой этиологии#2) Стойкое понижение слуха (3 и более месяца) любой этиологии, одно- и двустороннее (острота слуха: шепотная речь не менее 3 м)#3) Острота зрения с коррекцией ниже 0,5 на одном глазу и ниже 0,2 - на другом или 0,7 при отсутствии бинокулярного зрения#4) Беременность и период лактации#", 2, "1 раз в 2 года", "Работа лифтера (к приему на работу для лифтеров обычных лифтов противопоказаний нет)", "1.2." },
                    { 2255, "1) Стойкое понижение слуха (3 и более месяца) любой этиологии, одно- и двустороннее (острота слуха: шепотная речь не менее 3 м) (кроме работ по ремонту и эксплуатации ЭВМ), за исключением отсутствия слуха, выраженных и значительно выраженных нарушений слуха (глухота и III, IV степень тугоухости) у лиц, прошедших профессиональное обучение, в том числе обучение безопасным методам и приемам выполнения работ#2) Острота зрения с коррекцией ниже 0,5 на одном глазу и ниже 0,2 - на другом#3) Стойкое слезотечение, не поддающееся лечению#4) Ограничение поля зрения более чем на 20° по любому из меридианов#5) Нарушение функции вестибулярного анализатора любой этиологии#6) Беременность и период лактации#", 2, "1 раз в 2 года", "Работы по обслуживанию и ремонту действующих электроустановок с напряжением 42 В и выше переменного тока, 110 В и выше постоянного тока, а также монтажные, наладочные работы, испытания и измерения в этих электроустановках", "2." },
                    { 2256, "1) Рецидивирующий тромбофлебит геморроидальных вен и вен нижних конечностей#2) Грыжи, препятствующие работе и имеющие склонность к ущемлению при выполнении работ средней тяжести#3) Хронические заболевания периферической нервной системы с обострениями 3 раза и более за календарный год при выполнении работ средней тяжести#4) Стойкое понижение слуха (3 и более месяца) любой этиологии, одно- и двустороннее (острота слуха: шепотная речь менее 3 м)#5) Нарушение функции вестибулярного анализатора любой этиологии#6) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#7) Острота зрения с коррекцией ниже 0,5 на одном глазу и ниже 0,2 - на другом#8) Беременность и период лактации#", 2, "1 раз в 2 года", "Работы по валке, сплаву, транспортировке, первичной обработке, охране и восстановлению лесов", "3." },
                    { 2257, "1) Грыжи с наклонностью к ущемлению, выпадение прямой кишки#2) утратил силу#3) Нарушение функции вестибулярного анализатора любой этиологии#4) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#5) Хронические заболевания периферической нервной системы с обострениями 3 и более раза за календарный год#6) Острота зрения с коррекцией ниже 0,5 на одном глазу и ниже 0,2 - на другом#7) Стойкое слезотечение, не поддающееся лечению#8) Рецидивирующая язвенная болезнь желудка и 12-перстной кишки с обострениями 2 раза и более за календарный год#9) Хронические заболевания гепатобилиарной системы с обострениями 2 раза и более за календарный год#10) Бронхиальная астма#11) Хронические воспалительные и дисгормональные заболевания матки и придатков с частотой обострения 3 раза и более за календарный год#12) Хронические болезни почек и мочевыводящих путей#13) Болезни полости рта, зубов и челюстей (хронический гингивит, стоматит, пародонтит), отсутствие зубов, множественный кариес#14) Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#15) Беременность и период лактации#", 2, "1 раз в год", "Работы в особых географических регионах со значительным удалением мест проведения работ от медицинских учреждений, оказывающих специализированную медицинскую помощь, включая:", "4." },
