                    { 2269, "1) Заболевания сердечно-сосудистой системы, даже при наличии компенсации#2) Хронические заболевания периферической нервной системы с частотой обострения 3 раза и более за календарный год#3) Хронические заболевания органов дыхания с частотой обострения 3 раза и более за календарный год#4) Хронические болезни зубов, полости рта, отсутствие зубов, мешающее захватыванию загубника, наличие съемных протезов, альвеолярная пиоррея, стоматиты, периодонтит, анкилозы и контрактуры нижней челюсти, челюстной артрит#5) Общее физическое недоразвитие и недоразвитие опорно-двигательного аппарата#6) Доброкачественные новообразования, препятствующие выполнению работ в противогазах#7) Грыжи (все виды)#8) Облитерирующие заболевания сосудов вне зависимости от степени компенсации#9) Варикозная болезнь и рецидивирующий тромбофлебит нижних конечностей и геморроидальных вен. Лимфангиит и другие нарушения лимфооттока#10) Искривление носовой перегородки с нарушением функции носового дыхания#11) Хронические заболевания среднего уха с частотой обострения 3 раза и более за календарный год#12) Стойкое понижение слуха (3 и более месяца) любой этиологии одно- и двустороннее (острота слуха: шепотная речь не менее 3 м)#13) Нарушение функции вестибулярного анализатора любой этиологии#14) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#15) Понижение остроты зрения ниже 0,8 на одном глазу и ниже 0,5 - на другом, коррекция не допускается#16) Хронические заболевания слезовыводящих путей, век, органические недостатки век, препятствующие полному их смыканию, свободному движению глазного яблока#17) Ограничение поля зрения более чем на 20°#18) Болезни эндокринной системы, требующие постоянной лекарственной коррекции#", 2, "1 раз в год", "Подземные работы", "12." },
                    { 2270, "1) Хронические заболевания периферической нервной системы с частотой обострения 3 раза и более за календарный год#2) Заболевания органов кровообращения, даже при наличии компенсации#3) Болезни зубов, полости рта, заболевания челюстно-лицевого аппарата (отсутствие зубов, наличие съемных протезов, анкилозы и контрактуры нижней челюсти, челюстной артрит)#4) Глаукома#5) Хронические заболевания верхних дыхательных путей#6) Хронические заболевания бронхолегочной системы с частотой обострения 2 раза и более за календарный год#7) Искривление носовой перегородки с нарушением функции носового дыхания#8) Деформация грудной клетки, вызывающая нарушение дыхания и затрудняющая работу в противогазах#9) Доброкачественные опухоли, препятствующие выполнению работ в противогазах#10) Хронические заболевания среднего уха#11) Заболевания вестибулярного анализатора любой этиологии#12) Понижение остроты зрения ниже 0,8 на одном глазу и ниже 0,5 - на другом, коррекция не допускается#13) Хронические заболевания слезовыводящих путей, век, органические недостатки век, препятствующие полному их смыканию, свободному движению глазного яблока#14) Ограничение поля зрения более чем на 10°#15) Стойкое понижение слуха (3 и более месяца) любой этиологии одно- и двустороннее (острота слуха: шепотная речь не менее 3 м), за исключением отсутствия слуха, выраженных и значительно выраженных нарушений слуха (глухота и III, IV степень тугоухости)#16) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#17) Беременность и период лактации#", 2, "1 раз в 2 года", "Работы, выполняемые с применением изолирующих средств индивидуальной защиты и фильтрующих противогазов с полной лицевой частью", "13." },
                    { 2271, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) педикулез;#6) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#7) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#8) гонорея (все формы) на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#9) инфекции кожи и подкожной клетчатки - только для работников акушерских и хирургических стационаров, отделений патологии новорожденных, недоношенных, а также занятых изготовлением и реализацией пищевых продуктов;#10) озена#", 2, "1 раз в год", "Работы в организациях пищевой промышленности, молочных и раздаточных пунктах, на базах и складах продовольственных товаров, где имеется контакт с пищевыми продуктами в процессе их производства, хранения, реализации, в том числе работы по санитарной обработке и ремонту инвентаря, оборудования, а также работы, где имеется контакт с пищевыми продуктами при транспортировке их на всех видах транспорта", "14." },
                    { 2272, "Заболевания и бактерионосительство:#1) брюшной тиф, паратифы, сальмонеллез, дизентерия;#2) гельминтозы;#3) сифилис в заразном периоде;#4) лепра;#5) педикулез;#6) заразные кожные заболевания: чесотка, трихофития, микроспория, парша, актиномикоз с изъязвлениями или свищами на открытых частях тела;#7) заразные и деструктивные формы туберкулеза легких, внелегочный туберкулез с наличием свищей, бактериоурии, туберкулезной волчанки лица и рук;#8) гонорея (все формы) на срок проведения лечения антибиотиками и получения отрицательных результатов первого контроля;#9) инфекции кожи и подкожной клетчатки - только для работников, занятых изготовлением и реализацией пищевых продуктов;#10) озена#", 2, "1 раз в год", "Работы в организациях общественного питания, торговли, буфетах, на пищеблоках, в том числе на транспорте", "15." },
                    { 2261, "1) Грыжи с наклонностью к ущемлению, выпадение прямой кишки#2) утратил силу#3) Нарушение функции вестибулярного анализатора любой этиологии#4) Заболевания любой этиологии, вызывающие нарушение функции вестибулярного аппарата, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.)#5) Хронические заболевания периферической нервной системы с обострениями 3 и более раза за календарный год#6) Острота зрения с коррекцией ниже 0,5 на одном глазу и ниже 0,2 - на другом#7) Стойкое слезотечение, не поддающееся лечению#8) Рецидивирующая язвенная болезнь желудка и 12-перстной кишки с обострениями 2 раза и более за календарный год#9) Хронические заболевания гепатобилиарной системы с обострениями 2 раза и более за календарный год#10) Бронхиальная астма#11) Хронические воспалительные и дисгормональные заболевания матки и придатков с частотой обострения 3 раза и более за календарный год#12) Хронические болезни почек и мочевыводящих путей#13) Болезни полости рта, зубов и челюстей (хронический гингивит, стоматит, пародонтит), отсутствие зубов, множественный кариес#14) Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#15) Беременность и период лактации#", 2, "1 раз в год", "Работы, выполняемые по трудовым договорам в районах Крайнего Севера и приравненных к ним местностях", "4.4." },
                    { 2192, "Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год и аллергодерматозы#Тотальные дистрофические и аллергические заболевания верхних дыхательных путей#Хронические заболевания бронхолегочной системы с частотой обострения 3 раза и более за календарный год#Гиперпластический ларингит#Выраженные расстройства вегетативной (автономной) нервной системы#", 1, "1 раз в 2 года", "полиакрилаты: полиметакрилаты (оргстекло, плексиглаз), полиакрилонитрил, полиакриламид и прочие (производство)", "1.3.4.2." },
                    { 2082, "Аллергические заболевания различных органов и систем#", 1, "1 раз в год", "Аллергены, \"А\"", "1.1.1." },
