                    { 2111, "Хронические заболевания гепатобилиарной системы#Снижение гемоглобина менее 130 г/л у мужчин и менее 120 г/л у женщин#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#Выраженные расстройства вегетативной (автономной) нервной системы#", 1, "1 раз в 2 года", "Гидразин и его производные: фенилгидразин гидрохлорид, борингидразин, диметилгидразин (гептил)К", "1.2.10." },
                    { 2112, "Тотальные дистрофические заболевания верхних дыхательных путей#Хронические заболевания гепатобилиарной системы#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#Выраженные расстройства вегетативной (автономной) нервной системы#Искривления носовой перегородки, препятствующие носовому дыханию#", 1, "1 раз в 2 года", "Дибензодиоксины полихлорированные (ПХДД)К, дибензофураны полихлорированные (ДБФ), дифенилы (ДФ)К", "1.2.11." },
