                    { 2114, "Тотальные дистрофические и аллергические заболевания верхних дыхательных путей#Хронические заболевания органов дыхания с частотой обострения 2 раза и более за календарный год#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#Кардиомиопатия (только для кобальта)#Искривления носовой перегородки, препятствующие носовому дыханию#", 1, "1 раз в 2 года", "Карбонилы металлов: железо пентакарбонил, кобальт гидотетракарбонилА и прочие", "1.2.13." },
