                    { 2117, "Тотальные дистрофические заболевания верхних дыхательных путей#Хронические заболевания переднего отрезка глаза#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#Искривления носовой перегородки, препятствующие носовому дыханию#", 1, "1 раз в 2 года", "Кислоты органические: метановая (муравьиная), этановая (уксусная), бутановая (масляная), пропионовая, 1-метилбутановая (изовалериановая), этадионовая кислота дигидрат (щавелевая), 4-метилпентановая (изокапроновая), проп-2-еновая (акриловая), бензойная и прочие; синтетические жирные кислоты", "1.2.15." },
                    { 2118, "Аллергические заболевания различных органов и систем#Снижение гемоглобина менее 130 г/л у мужчин и менее 120 г/л у женщин#Выраженные расстройства вегетативной (автономной) нервной системы#Хронические рецидивирующие заболевания кожи с частотой обострения 4 раза и более за календарный год#", 1, "1 раз в 2 года", "Бензол-1,3-дикарбоноваяА (изофталевая) и бензол-1,4-дикарбоноваяА (терефталевая) кислоты; кислот органических ангидриды и соли: 1,5-диметил-5-(1-циклогексен-1-ил) барбитурат натрияР", "1.2.16." },
